function set(e){this.sets=e}set.prototype={add:function(e){if($.isArray(e)){for(item in e){if($.inArray(e[item],this.sets)<0){this.sets.push(e[item])}}}else{if($.inArray(e,this.sets)<0){this.sets.push(e)}}return this.sets},remove:function(e){if(!$.isArray(e)){var t=this.sets.indexOf(e);if(t>-1){this.sets.splice(t,1)}}else{for(o in e){var t=this.sets.indexOf(e[o]);if(t>-1){this.sets.splice(t,1)}}}return this.sets},value:function(){return this.sets}}
